import React, { useState } from 'react';
import { Button, TextField, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import * as personelServices from '../services/zimmetServices';

const PersonelSearchPage = () => {
  const [sicilNo, setSicilNo] = useState('');
  const [name, setName] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  const handleSearch = async () => {
    try {
      const response = await personelServices.filterPersonel(sicilNo, name);
      setSearchResults(response.data);
    } catch (error) {
      console.error('Personel arama hatası:', error);
    }
  };

  return (
    <div>
      <TextField label="Sicil No" value={sicilNo} onChange={(e) => setSicilNo(e.target.value)} />
      <TextField label="Ad" value={name} onChange={(e) => setName(e.target.value)} />
      <Button onClick={handleSearch}>Ara</Button>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Sicil No</TableCell>
              <TableCell>Ad</TableCell>
              <TableCell>Soyad</TableCell>
              <TableCell>Zimmet İşlemleri</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {searchResults.map((personel) => (
              <TableRow key={personel.sicilNo}>
                <TableCell>{personel.sicilNo}</TableCell>
                <TableCell>{personel.name}</TableCell>
                <TableCell>{personel.surname}</TableCell>
                <TableCell>
                  <a href={`/zimmet/personel/${personel.sicilNo}/zimmet`}>Zimmet İşlemleri</a>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default PersonelSearchPage;
